import { Component, OnInit } from "@angular/core";
import { DatabaseService } from "../../services/database.service";
import { FormBuilder, FormGroup, Validators } from "@angular/forms";
import { PackingList } from "../../model/schema";
import { Image } from "../../model/base64";
import { Router } from "@angular/router";
import * as jsPDF from "jspdf";

@Component({
  selector: "app-import",
  templateUrl: "./import.component.html",
  styleUrls: ["./import.component.css"]
})
export class ImportComponent implements OnInit {
  processing = false;
  form: FormGroup;
  model;
  message;
  messageClass;
  userInvalid = false;
  total;
  items: any[] = [];
  messageClassItem;
  messageItem;
  base64 = new Image();
  remarks;
  title = "";
  date = "";
  preparedBy = "";
  currency = ["\u20B1 (PHP)", "\u0024 (USD)"];
  sign = this.currency[1];

  constructor(
    private dbService: DatabaseService,
    private formbuilder: FormBuilder,
    private router: Router
  ) {
    this.createForm();
    this.createModel();
    this.title = "";
    this.date = "";
    this.preparedBy = "";
  }

  ngOnInit() {
    this.loadItems();
    this.loadFields();
  }

  createModel() {
    const val: any = {
      quantity: "",
      unit: "",
      description: "",
      price: ""
    };
    this.model = val;

    //console.log(this.model);
  }

  createForm() {
    this.form = this.formbuilder.group({
      title: [
        "",
        Validators.compose([
          Validators.maxLength(50),
          this.validateNumberAndLettersAndSpecial
        ])
      ],
      preparedBy: [
        "",
        Validators.compose([Validators.maxLength(50), this.validateLetters])
      ],
      date: [
        "",
        Validators.compose([Validators.maxLength(10), this.validateDate])
      ],
      description: [
        "",
        Validators.compose([
          Validators.required,
          this.validateNumberAndLettersAndSpecial
        ])
      ],
      remarks: [
        "",
        Validators.compose([
          Validators.required,
          this.validateNumberAndLettersAndSpecial
        ])
      ],
      sign: [""],
      unit: [
        "",
        Validators.compose([
          Validators.maxLength(20),
          this.validateNumberAndLettersAndSpecial
        ])
      ],
      quantity: [
        "",
        Validators.compose([Validators.maxLength(10), this.validateNumber])
      ],
      price: ["", Validators.compose([this.validateNumber])]
    });
  }

  validateDate(controls) {
    const regExp = new RegExp(
      /^(0[1-9]|1[0-2])\/(0[1-9]|1\d|2\d|3[01])\/(19|20)\d{2}$/
    );

    if (regExp.test(controls.value)) {
      const value = controls.value.split("/");
      //console.log(value[2])
      if (
        ((value[0] == "02" && value[1] == "31") ||
          (value[0] == "02" && value[1] == "30")) &&
        Number(value[2]) > 1900
      ) {
        return { validateDate: true };
      } else {
        return null;
      }
    } else {
      return { validateDate: true };
    }
  }

  validateLetters(controls) {
    const regExp = new RegExp(/^[a-zA-Z\s]+$/);

    if (regExp.test(controls.value)) {
      return null;
    } else {
      return { validateLetters: true };
    }
  }

  validateNumberAndLetters(controls) {
    const regExp = new RegExp(/^[a-zA-Z0-9\s]*$/);

    if (regExp.test(controls.value)) {
      return null;
    } else {
      return { validateNumberAndLetters: true };
    }
  }

  validateNumberAndLettersAndSpecial(controls) {
    const regExp = new RegExp(/^[a-zA-Z0-9\-@_():.+\n\s\u2013\u2014]*$/);

    if (regExp.test(controls.value)) {
      return null;
    } else {
      return { validateNumberAndLettersAndSpecial: true };
    }
  }

  validateNumber(controls) {
    const regExp = new RegExp(/^[0-9]*$/);

    if (regExp.test(controls.value)) {
      return null;
    } else {
      return { validateNumber: true };
    }
  }

  addItem() {
    var qty = this.model.quantity;
    var price = this.model.price;
    var subtotal = parseFloat(qty) * parseFloat(price);

    if (qty === undefined || qty === "") {
      this.messageClassItem = "alert alert-danger";
      this.messageItem = "Quantity field is empty!";
    } else {
      if (this.model.unit == undefined || this.model.unit == "") {
        this.messageClassItem = "alert alert-danger";
        this.messageItem = "Unit field is empty!";
      } else {
        if (
          this.model.description == undefined ||
          this.model.description == ""
        ) {
          this.messageClassItem = "alert alert-danger";
          this.messageItem = "Description field is empty!";
        } else {
          if (this.model.price == undefined || this.model.price == "") {
            this.messageClassItem = "alert alert-danger";
            this.messageItem = "Price field is empty!";
          } else {
            const value = {
              description: this.model.description,
              unit: this.model.unit,
              quantity: this.model.quantity,
              price: Number(this.model.price).toLocaleString("en-us", {
                minimumFractionDigits: 2
              }),
              total: subtotal.toLocaleString("en-us", {
                minimumFractionDigits: 2
              })
            };
            //console.log(this.items);
            this.items.push(value);
            this.saveItem();
            this.messageClassItem = "alert alert-success";
            this.messageItem = "Item is added to list!";
            this.createModel();
          }
        }
      }
    }

    setTimeout(() => {
      this.messageClassItem = "";
      this.messageItem = "";
    }, 2000);
  }

  saveItem() {
    localStorage.setItem("importItems", JSON.stringify(this.items));
    this.loadItems();
  }

  saveFields() {
    const val = {
      title: this.title,
      date: this.date,
      preparedBy: this.preparedBy,
      sign: this.sign,
      remarks: this.remarks
    };

    localStorage.setItem("importFields", JSON.stringify(val));
    //console.log(val);
    this.loadFields();
  }

  loadFields() {
    const jsonFields = localStorage.getItem("importFields");
    var val = jsonFields != null ? JSON.parse(jsonFields) : [];
    //var val = localStorage.getItem("importFields");
    //console.log(val);
    if (val !== null) {
      this.title = val["title"];
      this.date = val["date"];
      this.preparedBy = val["preparedBy"];
      this.sign = val["sign"];
      this.remarks = val["remarks"];
    }
  }

  loadItems() {
    const jsonItems = localStorage.getItem("importItems");
    var val = jsonItems != null ? JSON.parse(jsonItems) : [];
    //var val = localStorage.getItem("importItems");
    if (val !== null) {
      this.items = val;
    } else {
      this.items = [];
    }
  }

  clearItems() {
    localStorage.removeItem("importItems");
    localStorage.removeItem("importFields");
    this.title = "";
    this.date = "";
    this.preparedBy = "";
    this.sign = this.currency[1];
    this.remarks = "";
    this.saveFields();
    this.loadItems();
  }

  deleteItem(input) {
    // removes ITEM on CART
    //console.log(input);
    //console.log(this.items);
    if (this.items.length > 0) {
      for (var key in this.items) {
        if (this.items.hasOwnProperty(key)) {
          if (this.items[key].description == input) {
            //this.items.splice(key,1);
            this.items.splice(this.items.indexOf(key), 1);
            if (this.items.length == 0) {
              /* this.totalmeasurement = '';
                this.totalweight = ''; */
            }
            this.saveItem();
            break;
          }
        }
      }
    }
  }

  pdf() {
    if (this.items.length > 0) {
      this.downLoadPDF();
    } else {
      this.messageClassItem = "alert alert-danger";
      this.messageItem =
        "Item list is empty! Please insert an item and try again.";
      setTimeout(() => {
        this.messageClassItem = "";
        this.messageItem = "";
      }, 3000);
    }
  }

  downLoadPDF() {
    const doc = new jsPDF();
    var start = 86;
    var space = 5;

    var imgDataUSD =
      "data:image/png;base64,";

    var imgDataPHP =
      "data:image/png;base64,";

    var imgData;

    if (this.sign == "\u0024 (USD)") {
      imgData = imgDataUSD;
    } else {
      imgData = imgDataPHP;
    }

    doc.addImage(imgData, "JPEG", 0, 0, 210, 300);

    doc.setFontSize(12);
    doc.setFontStyle("Arial");
    var date = this.date;
    var title = this.title;
    var preparedBy = this.preparedBy;
    var remarks = this.remarks;
    var start = 87;
    var spacing = 3;
    var space = 5;
    var itemCount = 0;
    var end;
    //console.log(this.items);

    for (const key in this.items) {
      if (this.items.hasOwnProperty(key)) {
        const element = this.items[key];
        //console.log(element);
        itemCount++;
        end = start;
        var unit = element.unit;
        var desc = element.description;
        var price = element.price;
        var total = element.total;
        var qty = element.quantity;
        var unitEnd;
        var desEnd;

        var chunks: any = [];
        var num = 10;

        for (var i = 0; i < unit.length; i += num) {
          chunks.push(unit.substring(i, i + num));
        }

        for (var i = 0; i < chunks.length; i += 1) {
          doc.text(37, start, chunks[i]);
          start += space;
        }
        unitEnd = start;
        chunks = [];
        num = 35;
        start = end;

        for (var i = 0; i < desc.length; i += num) {
          chunks.push(desc.substring(i, i + num));
        }

        for (var i = 0; i < chunks.length; i += 1) {
          doc.text(62, start, chunks[i]);
          start += space;
        }
        desEnd = start;

        start = unitEnd > desEnd ? unitEnd : desEnd;

        doc.setLineWidth(0.5);
        doc.line(9, start - space + 3, 201, start - space + 3);

        var centerMiddle = (end + start) / 2 - 3;
        doc.text(25, centerMiddle, qty, "center");
        doc.text(13, centerMiddle, itemCount.toString(), "center");
        doc.text(145, centerMiddle, price, "center");
        doc.text(180, centerMiddle, total, "center");
        start += spacing;
      }
    }

    doc.text(164, 59, date);
    doc.text(20, 59, title);
    doc.text(20, 237, remarks);

    doc.text(171, 288, preparedBy, "center");
    doc.save("Import-List(" + date + ").pdf");
    this.clearItems();
  }
}
